summary:
Laura Ferguson (02) 6230 7666
La Trobe Street location
Contract till June 2020 + extension options
Our client a Federal Government Department charged with the responsibility of delivering government programs for veterans and members of defence forces is seeking an APS5/6 Data Analyst for an hourly rate contract through till end of June 2020 (with possible extension), starting ASAP, based in Melbourne.

Working closely with key stakeholders within Client Access and Rehabilitation Branch, the successful applicant will be responsible for transforming the Branch monthly reporting to a new Dashboard style of reporting and working on section reports.

The successful candidate will be required to demonstrate:
Knowledge and understanding in the design and development of reporting tools and Dashboards;
Highly proficient in Excel;
Experience in analysing data sets;
Strong analytical skills;
Experience analysing and reporting on data trends and patterns;
Ability to transfer knowledge of management and maintenance of the new Dashboard style reporting to the team;
Experience in moving from data driven manual input to a contemporary style trend representation;
Excellent communication skills;
Ability to work autonomously as well as part of a team;
Ability to manage competing priorities and tight deadlines.

Key Responsibilities will include:
Undertake data analysis and reporting including interpreting data, analysing the results and using creative techniques to produce reports to meet end-user needs;
Reviewing and refining existing reports;
Writing procedures and transferring knowledge to the team on management of the new Dashboard style of reporting, as well as ongoing maintenance requirements;
Design, develop and coordinate reports for sections/teams within the Client Access and Rehabilitation Branch (CARB ) of the Department;
Inform and create visibility for the Branch/Section Leadership Team on progress against key strategic deliverables, metrics and key performance indicators;
Aid operational and tactical decisions by providing data analysis support;
Use analysed data to identify business process improvement opportunities;
Run queries, preparation of report/s and presenting findings.

For further details please contact Laura Ferguson at Laura@fprs.com.au

FIRST PEOPLE Recruitment Solutions is a 100% Indigenous Owned Business providing temporary assignments, fixed term contracts and permanent recruitment solutions to the Australian Government and Commercial Organisations.

Our Head Office is based in Canberra with a national reach to all the states and territories, regional and remote areas of Australia.

FIRST PEOPLE Recruitment Solutions encourage applications from Indigenous Australians and Non-Indigenous Australians together with people from culturally diverse backgrounds.
3020594

Data Analyst (Research)
Flexible - Part Time or Full-Time Position: 0.8-1.0FTE
Salary: $70k - $85k depending on experience, + superannuation (9.5%), with access to Health Promotion Charity Income Tax Free Benefits of up to $ 18,549
About HSM:
Hello Sunday Morning is an innovative digital health organisation helping people to change their relationship with alcohol. We aim to create a workplace that recognises the importance of connection, meaningful work, balanced lifestyles, psychological wellbeing and continual learning whilst being guided by our core values - Pioneering, Authenticity, Empathetic, Respect and Supportive. At Hello Sunday Morning we pride ourselves on being a workplace where the best people come and do their best work.
About the Role:
Reporting to the Research Manager, our Data Analyst will conduct standard analysis on data stored in relational-databases and with 3rd-party platforms (via API’s). This includes the preparation of extracts and reports, data visualisation and dashboarding.
Our Data Analyst will assist in statistical model building and deployment. This will include assistance building data pipelines, assessing models for goodness of fit and assistance in containerisation and deployment to a cluster. It’s essential that you are able to:
Perform day-to-day data extraction, cleansing, transformation and loading;
Conduct data cleaning for internal and external reporting purposes;
Conduct exploratory data analysis (EDA) to support model building and clinical research;
Prepare data analysis, visualisation and reporting for various stakeholders;
Assist in dashboard builds for various HSM stakeholders;
Classify and reclassify highly sensitive data;
Maintain meticulous records whilst adhering to strict confidentiality requirements;
Provide research support for the development and evaluation of Daybreak;
Develop relevant policies, protocols and documentation;
Undertake ongoing quality assurance of data;
Regularly meet with supervisors to discuss data opportunities and strategies;
About You:
The ideal person for this role will come with the following:
Masters Post Graduate qualification in IT, Science, Statistical Analysis, Health or a relevant scientific discipline;
At least 3 years experience in deep data analysis;
Experience writing ETL scripts for Apache Spark and ability to handle large datasets, data cleansing, de-identification techniques and data visualization.
Proficiency with Python programing language and SQL.
Proven ability to collaborate with diverse teams and track multiple streams of information in a dynamic, technical, rapid growth environment;
Excellent interpersonal, verbal and written communication skills, with a high level of attention to detail;
Proven ability to work independently and as part of a high performing team.
It will be a bonus if you have:
Experience complying with ethics relating to health data management, research and governance as well as a knowledge or interest in managing health data;
Experience working on or writing manuscripts for publication
PhD in a relevant discipline;
Experience with AWS services like AWS Glue, EMR, Redshift and S3.

About the Perks:
In return, we’ve got on offer for you:
We proactively foster career development and invest in professional development to build on your existing skills. This role comes with an annual professional development budget to attend professional development training and/or conferences.
We have a vibrant workplace culture with a strong sense of community and inclusion.
Our office is conveniently located in Surry Hills, a short walk from Central Station.
We have quarterly team outings
We love dogs. You can bring your dog to work!

To Apply:
Please send your CV and a cover letter
 addressing the following points:
Outline your technical experience, including any experience with SQL or Cloud based services.
Outline your research experience.
Why you want to work for a Not-for-Profit.
Due to the anticipated high volume of applications, we will not be able to accept candidates who do not provide a cover letter that outlines these areas.
